The Amazing Race
Season 19, Episode 5 - I Feel Like I'm In The Circus - Aired on 23rd of October 2011

The eight remaining teams depart from the floating village of Koh Panyi near Phuket, Thailand and continue on the fifth leg of The Amazing Race, with one team facing a Speed Bump in the next leg.

